def annotate(text):
    import re
    words = re.findall(r"\w+", text)
    result = []
    for w in words:
        lw = w.lower()
        if lw in {'the','a','an'}:
            tag='DT'
        elif lw in {'and','or','but'}:
            tag='CC'
        elif lw in {'is','are','was','were','be','been'}:
            tag='VB'
        elif lw.endswith('ly'):
            tag='RB'
        elif lw.endswith('ing') or lw.endswith('ed'):
            tag='VB'
        else:
            tag='NN'
        result.append((w, tag))
    return result
